import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import PersonalizeExperience from './PersonalizeExperience';
import GenderSelection from './GenderSelection';
import AgeSelection from './AgeSelection';
import WeightSelection from './WeightSelection';
import HeightSelection from './HeightSelection';
import ProgressIndicator from '../components/ProgressIndicator';

function App() {
  const [completedSteps, setCompletedSteps] = useState([false, false, false, false]);
  const [gender, setGender] = useState(null);
  const [age, setAge] = useState(null);
  const [weight, setWeight] = useState(null);
  const [height, setHeight] = useState(null);

  return (
    <Router>
      <div>
        <ProgressIndicator completedSteps={completedSteps} />
        <Routes>
          <Route path="/" element={<PersonalizeExperience />} />
          <Route path="/gender" element={<GenderSelection setCompletedSteps={setCompletedSteps} setGender={setGender} />} />
          <Route path="/age" element={<AgeSelection setCompletedSteps={setCompletedSteps} setAge={setAge} />} />
          <Route path="/weight" element={<WeightSelection setCompletedSteps={setCompletedSteps} setWeight={setWeight} />} />
          <Route path="/height" element={<HeightSelection setCompletedSteps={setCompletedSteps} setHeight={setHeight} weight={weight} />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
